import React from 'react';
import './Field.css';

function Field({fieldname,stack_image}) {
    return (
        <div>
            <div className='stack_image'>
                <img classsrc={stack_image}/>
            </div>
            <div className='field_name'>
                <p>{fieldname}</p>
            </div>
        </div>
    )
}

export default Field
